import React from "react";
import "./StoryLineStory.scss";

interface StoryLineStoryProps {
    image: string;
    link: string;
}

const StoryLineStory = (StoryLineStoryProps: StoryLineStoryProps) => {
    const { image, link } = StoryLineStoryProps;
    return (
        <div className="StoryLineStory">
            <a className="StoryLineStory" href={link}>
                <img src={require(`../../assets/${image}`)} alt="" />
            </a>
        </div>
    );
};

export default StoryLineStory;
